import React, { useState, useEffect } from "react";

function CurrentInfo(props) {
  const kelvinToFarenheit = (k) => {
    return (k - 273.15).toFixed(2);
  };

  return (
    <div className="daily-info">
      <div className="main-info-left">
        {console.log("Render of CurrentInfo. Below is the object")}
        {console.log(props.cityInfo)}
        <h2>{props.cityName}</h2>
        <p>Temperature: {props.cityInfo.temp}</p>
        <p>Feels like: {props.cityInfo.feels_like}</p>
      </div>
      <div className="main-info-right">
        <div className="weather-icon">
          <p>Weather: {props.weather[0].main}</p>
        </div>

        <p>Max: {props.cityInfo.temp_max}</p>
        <p>Min: {props.cityInfo.temp_min}</p>
      </div>
    </div>
  );
}

export default CurrentInfo;
